    <div className='App'>
      <Header/>
      <Nav setAddAthlete={setAddAthlete} ddAthlete={addAthlete}/>
      {addAthlete ? <CreateNewAthleteForm setAddAthlete={setAddAthlete} a/> : null}
      <AthleteContainer/>
      {/* <Calendar/> */}
    </div>
  );
}

export default App;
